import React, {useState} from "react";
import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';
import { Link } from "react-router-dom";

const { Header, Sider, Content } = Layout;

const Home = () => {
    const [collapsed, setCollapsed] = useState(false)

    const toggle = () => {
    setCollapsed(!collapsed)
    };

    const currentUser = JSON.parse(sessionStorage.data).data
    const token = JSON.parse(sessionStorage.data).token

    console.log(token);
    return (
    <Layout>
        <Sider trigger={null} collapsible collapsed={collapsed}>
          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={['/profil']}>
            <Menu.Item key="/profil" icon={<UserOutlined />}>
              Edit Profil
              <Link to="/profil" />
            </Menu.Item>
            <Menu.Item key="/produk" icon={<VideoCameraOutlined />}>
              Tambah Produk
              <Link to="/produk" />
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }}>
            {React.createElement(collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
              className: 'trigger',
              onClick: {toggle},
            })}
          </Header>
          <Content
            className="site-layout-background"
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
            }}
          >
            <h1>PROFIL</h1>
            Nama: {currentUser.nama} <br/>
            Email: {currentUser.email} <br/>
            Jenis Kelamin: {currentUser.gender}
          </Content>
          <Content
            className="site-layout-background"
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
            }}
          >
            Content2
          </Content>
        </Layout>
      </Layout>
    );
};


export default Home
